import "./App.css";
import React, { useRef } from "react";
import { Outlet } from "react-router-dom";
import Cookies from "js-cookie";

function App() {
  const backendCookie = useRef(null);
  const frontendCookie = useRef(null);
  backendCookie.current = Cookies.set("token", "null", { expires: 1 });
  frontendCookie.current = Cookies.set("user", "null", { expires: 1 });

  return (
    <div className="App">
      <Outlet />
    </div>
  );
}

export default App;
